export default (req: any, res: any) => {
	if (req.method === 'GET') {
		res.statusCode(200);
		res.json({
			name: 'Fielis',
			email: 'padrefidelis111@gmail.com',
		});
		// Process a POST request
	} else {
		// Handle any other HTTP method
		//Handle Get
	}
};
